import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import ImageIcon from '@mui/icons-material/Image';
import WorkIcon from '@mui/icons-material/Work';
import BeachAccessIcon from '@mui/icons-material/BeachAccess';
import Divider from '@mui/material/Divider';
import boy from './assets/Avatars/boy.png';
import "/"

export default function Rightbar() {
  return (
    <List
      sx={{
        width: '100%',
        maxWidth: 360,
        bgcolor: 'background.paper',
      }}
    >
      <ListItem>
          <Avatar src={boy}/>
        <ListItemText primary="Ezzkalash" secondary="ezzo" />
      </ListItem>
      <ListItem>
          <Avatar src={boy}/>
        <ListItemText primary="Ward" secondary="Ward Daragmah" />
        <p>Follow</p>

      </ListItem>      <ListItem>
          <Avatar src={boy}/>
        <ListItemText primary="noor" secondary="NoorAdawi" />
        <p>Follow</p>

      </ListItem>      <ListItem>
          <Avatar src={boy}/>
        <ListItemText primary="mahmoud" secondary="Mahmoud Kalash" />
        <p>Follow</p>

      </ListItem>




      <ListItem>
        <ListItemAvatar>
          <Avatar>
            <WorkIcon />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="Work" secondary="Jan 7, 2014" />
      </ListItem>
      <ListItem>
        <ListItemAvatar>
          <Avatar>
            <BeachAccessIcon />
          </Avatar>
        </ListItemAvatar>
        <ListItemText primary="Vacation" secondary="July 20, 2014" />
      </ListItem>
    </List>
  );
}
